def dailyTemperatures(temperatures):
    stack = deque([])
    res = [0] * len(temperatures)
    for i, current_temperature in enumerate(temperatures):
        while stack and current_temperature > temperatures[stack[-1]]:
            prev = stack.pop()
            res[prev] = i - prev
        stack.append(i)
    return res
